class Scene {

    constructor() {
        this.models = [];
        this.lights = [];
    }

    addModel(model) {
        model.parent = this;
        this.models.push(model);
    }

    removeModel(model) {
        const index = this.models.indexOf(model);
        if (index !== -1) {
            model.destroy();
            this.models.splice(index, 1);
        }
    }

}

